my $lgf = $folder.'1Cv8.lgf';
open($fh, '<:encoding(UTF-8)', $lgf) or die "Could not open file '$lgf' $!";
while (<$fh>){
    $id_start =$1 if(/\_\$Session\$\_\.Start\",(\d+)/);
